INSERT INTO `decant_category_questions` (`id`, `category_id`, `question`, `file`, `status`, `answer`, `dpt`, `created_at`, `created_by`) VALUES
(1, '1', 'No one carries mobile phone', 'not_required', '1', 'Yes', '2', '2024-04-03 11:10:55', '1'),
(2, '1', 'Make sure both TL Driver & pump staff use PPEs during decantation process (PPEs, Safety Halmet, Hand gloves, Mask, & Safety shoes)', 'not_required', '1', 'Yes', '2', '2024-04-03 11:11:11', '1'),
(3, '1', 'No fire ignition source should be near product decantation area.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:11:28', '1'),
(4, '1', 'TL should be on flat ground, engine switched off and not obstructing traffic.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:11:53', '1'),
(5, '1', 'Fire extinguisher & Sand buckets placed nearby the Decant area', 'not_required', '1', 'Yes', '2', '2024-04-03 11:12:08', '1'),
(6, '1', 'Tanker Vent slightly to be opened', 'not_required', '1', 'Yes', '2', '2024-04-03 11:12:33', '1'),
(7, '1', 'Allow  30 to 25  minutes product settling time', 'not_required', '1', 'Yes', '2', '2024-04-03 11:12:53', '1'),
(8, '1', 'Check UGT space for decanting product ', 'not_required', '1', 'Yes', '2', '2024-04-03 11:13:10', '1'),
(9, '1', 'Make sure seals are intact properly ', 'not_required', '1', 'Yes', '2', '2024-04-03 11:13:29', '1'),
(10, '1', 'Take Dip of tanker while applying dipping and water finding paste on dip rod', 'not_required', '1', 'Yes', '2', '2024-04-03 11:13:45', '1'),
(11, '2', 'Earthling cable to be connected with tanker and the earth ground point', 'not_required', '1', 'Yes', '2', '2024-04-03 11:14:14', '1'),
(12, '2', 'Decantation hose to be connected with underground tank point first than with tanker ', 'not_required', '1', 'Yes', '2', '2024-04-03 11:14:30', '1'),
(13, '2', 'Station staff & driver  has to check both earthling cable and hose connection, whether connected properly.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:14:46', '1'),
(14, '2', 'Make sure UGT Green hose pipe Mark for Gasoline & Gray hose pipe for Diesel', 'not_required', '1', 'Yes', '2', '2024-04-03 11:15:01', '1'),
(15, '2', 'Station staff Retain product sample from tanker in glass made brown bottle before decantation (Sample should be seal properly & sign by driver)', 'not_required', '1', 'Yes', '2', '2024-04-03 11:15:21', '1'),
(16, '2', 'Stop fuel Sale to customer during decantation process', 'not_required', '1', 'Yes', '2', '2024-04-03 11:15:40', '1'),
(17, '2', 'Driver to release air pressure before decantation starts.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:15:56', '1'),
(18, '2', 'Driver to open decantation valve for starting decantation.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:16:16', '1'),
(19, '3', 'After Complete decantation remove hose pipe first from tanker and after from UGT ', 'not_required', '1', 'Yes', '2', '2024-04-03 11:16:37', '1'),
(20, '3', 'Station staff has to collect all remaining product using silver bucket attach with earting cable.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:17:20', '1'),
(21, '3', 'Station staff has to check from the top of tanker if tanker is empty or not (Don’t use mobile torch)', 'not_required', '1', 'Yes', '2', '2024-04-03 11:17:44', '1'),
(22, '3', 'Now station staff  has to sign delivery receipt.', 'not_required', '1', 'Yes', '2', '2024-04-03 11:18:16', '1'),
(23, '3', 'Make sure safely exit of TL from station', 'not_required', '1', 'Yes', '2', '2024-04-03 11:18:35', '1');
